export default function getData () {
  const cardData = [];
  let getData = async ()  => {
    console.log("getdata")
    const request = await fetch("https://6075786f0baf7c0017fa64ce.mockapi.io/products");
    const data = await request.json();
    return data.map((item) => {
      return cardData.push(item);
    });
  }
  getData();
  return cardData
}
